import Botao from '../Botao'
import './EspacoBotoes.css'

const EspacoBotoes = ({nome, imagem}) => {

    return(
        <section className='espaco-botoes'>
            <Botao
                nome={nome}
                imagem={imagem}
            />
            <Botao
                nome={nome}
                imagem={imagem}
            />
            <Botao
                nome={nome}
                imagem={imagem}
            />
        </section>
    )
}

export default EspacoBotoes
